b'Project Level x F21 is about resolution and progress. Join us on our journey of healing, growth and opportunity.

As a company, Forever 21 is\xc2\xa0 committed to shifting our corporate culture.\xc2\xa0 We are re-thinking what sensitivity training really means in the retail landscape. We want to create a progressive in-store program for our employees that boldly addresses \xe2\x80\x9cShopping while Black.\xe2\x80\x9d We want to create protocols that make Black and all customers of color feel safer. 
Forever 21 is proud to announce a collaboration designed by the youth of Project Level, a capsule injected with their entrepreneurial spirit.
